import styled from "styled-components";

export const LoginWrapper = styled.div`

    h1 {
        margin: 10px;
    }

    .container {
        display:flex;
        justify-content: center;
        flex-flow: column nowrap;
        margin: 150px;
        border: 1px solid black;
        padding: 50px 5px 50px 5px;
        width: 600px;
    }

    form {
        width: 300px;
    }

    input {
        padding: 5px 100px 5px 10px;
    }

    label {
        margin: 8px;
    }

`;
